import React from 'react';
import { Text, StyleSheet, View, Button } from 'react-native';

const Test = (props) => {
  console.log('props', props);

  return (
    <View>
      <Text>{props.anyData}</Text>
      <Button title='LOG!!!' onPress={() => console.log('log!!!')} />
    </View>
  );
};

export default Test;
